import React from "react";
import "./HowToDO.css";
import image1 from "../User-images/laptop35.webp";
function HowToDo() {
  return (
    <div>
      <br />
      <h1 style={{ textAlign: "center", fontFamily: "sans-serif" }}>
        <b>How-To</b>
        <br />
        <h5
          style={{
            // paddingLeft: "5%",
            fontFamily: "inherit",
            color: "black",
          }}
        >
          <b>Latest Laptop How-Tos :</b>
        </h5>
        <hr
          style={{
            marginLeft: "5%",
            marginRight: "5%",
          }}
        />
        <div className="mainSection">
          <div className="card-row">
            <div className="card-image">
              <img src={image1} alt="Card Image" />
            </div>
            <div className="card-content">
              <h5 className="card-title">
                How to Build a PC: The Ultimate Beginner's Guide
              </h5>
              <p className="card-text">
                PC building is infinitely varied, so no guide can cover every
                scenario. But we'll cover the most common issues you'll face
                assembling a desktop in 2023. You may decide to go fancier or
                more budget-focused with your build, but you'll walk away with a
                great grounding in what you need to know to do the job with
                confidence.
              </p>
            </div>
          </div>
        </div>
      </h1>
    </div>
  );
}

export default HowToDo;
